(4, 4, 'Khuôn mặt đáng thương', 'Đôi môi này đi về ai (yeah)\r\nOk đêm nay sẽ là một đêm thật tuyệt (no no)\r\nYes Sir (ah hah Sơn Tùng MT)\r\nCơn mơ màng mùi hương theo làn gió cuốn em đi\r\nKề bên vai ai từng đêm (eh)\r\nNhẹ nhàng giờ này anh (eh mai sau)\r\nMang em về liệu rằng em còn nhớ tiếng yêu không\r\nỞ đây ngay phía sau em này (eh)\r\nLại một mình anh thôi níu giữ lại những âm thầm và nhớ\r\nĐừng khiến đôi môi dịu êm phải chịu ngàn giọt nước mắt đắng cay\r\nHạt mưa rơi tình chơi vơi giấc mơ này biết đi về đâu oh\r\nBài hát khi xưa anh viết bây giờ phải đặt dấu chấm hết thôi\r\n(Ở cuối con đường) anh xin một điều ước\r\nCho em bình yên vững bước chân cánh hoa úa tàn bước chân khép màn\r\nBóng ai xa ngút ngàn nước mắt rơi ướt tràn\r\nSầu làn mi khép tình buồn nay em\r\nBiết đi về chốn đâu khuôn mặt đáng thương\r\nTấm thân héo mòn nỗi đau có còn\r\nĐắng cay em đã chọn chính em đã chọn\r\nRời làn hơi ấm tình này không thấm\r\nBiết ai còn nhớ ai khuôn mặt đáng thương\r\nCánh hoa úa tàn em giờ không phải em mà anh thì không phải em mà\r\nKhuôn mặt em yêu vẫn thế nhưng nay cảm xúc đã quá nhạt phai mà\r\nNơi đâu cho anh cảm xúc thăng hoa nơi đâu anh nhìn khoảng cách đôi ta\r\nKhông gian đâu không chắc cho em nhìn ra một con người đến từ hôm qua\r\nEm giờ đang ở nơi nào cơn gió mang em đi đến nơi nào (hu hu)\r\nBên cạnh ai kia ở nơi nào đôi chân em lang thang đến nơi nào\r\nNói cho anh nghe nói cho anh nghe\r\nBước đi vội vàng em đang đi bên ai đó\r\nĐừng khiến đôi môi dịu êm phải chịu ngàn giọt nước mắt đắng cay\r\nHạt mưa rơi tình chơi vơi giấc mơ này biết đi về đâu oh\r\nBài hát khi xưa anh viết bây giờ phải đặt dấu chấm hết thôi\r\n(Để cuối con đường) anh xin một điều ước\r\nCho em bình yên vững bước chân\r\nCánh hoa úa tàn bước chân khép màn\r\nBóng ai xa ngút ngàn nước mắt rơi ướt tràn\r\nSầu làn mi khép tình buồn nay em\r\nBiết đi về chốn đâu khuôn mặt đáng thương\r\nTấm thân héo mòn nỗi đau có còn\r\nĐắng cay em đã chọn chính em đã chọn\r\nRời làn hơi ấm tì