ize: 2rem;\">Dễ như nuốt thật nhanh ngụm cà phê cuối</span></div><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Dễ như cách em xua bàn tay để che tiếc nuối</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Dễ như cách em quay lại quay lại quay lại</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Chỉ để buông lời tha thứ nhân từ</span></div></span></div><div jsname=\"U8S5sf\" class=\"ujudUb\" style=\"margin-bottom: 12px;\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Vậy là lần cuối đi bên nhau</span></div><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Cay đắng nhưng không đau</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Nếu ai cũng mang tội thì người mong đợi gì nơi tôi?</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Tiễn em tới đây thôi</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Phố mưa cũng đang tạnh rồi</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Y như một giấc mơ trôi</span></div></span></div><div jsname=\"U8S5sf\" class=\"ujudUb\" style=\"margin-bottom: 12px;\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Kiệm lời tôi</span></div><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Xin tránh nói thêm về tương lai</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Xin tránh nói hẹn gặp lại</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Tránh nói về ngày mai</span></div></span></div><div jsname=\"U8S5sf\" class=\"ujudUb\" style=\"margin-bottom: 12px;\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Vì khó như nói câu vĩnh biệt những gì em đã mất</span></div><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Khoé mi nếu rưng rưng nhiều khi chỉ để đã mắt</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Khó như cách em tua lại tua lại tua lại</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Kỉ niệm trong đời tới lúc ban đầu</span></div></span></div><div jsname=\"U8S5sf\" class=\"ujudUb\" style=\"margin-bottom: 12px;\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Chỉ để lần cuối đi bên nhau</span></div><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Cay đắng nhưng không đau</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit; font-size: 2rem;\">Nếu ai cũng mang tội thì người mong đợi gì nơi tôi?</span></div></span><span jsname=\"YS01Ge\"><div style=\"text-align: center;\"><span style=\"color: inherit; font-family: inherit;